import Vue from 'vue'
import Router from 'vue-router'
import Home from './components/Home.vue'
import Task from './components/Task.vue';

Vue.use(Router)

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'home',
      alias: '/tasks',
      component: Home,
      children:[
        {
          path: '/task/:id',
          name: 'task-details',
          component: Task,
          props: true
        }
      ]
    },
    {
      path: '/addTask',
      name: 'add-task',
      component: () => import('./components/addTask.vue')
    },
    {
      path: '/editTask',
      name: 'edit-task',
      component: () => import('./components/editTask')
    }
  ]
})
